import React from "react";

export default function FirstTask() {
    function isValid(s) {
        let stack = [];
        let brackets = {
            ')' : '(',
            '}' : '{',
            ']' : '['
        };

        for (let i = 0; i < s.length; i++) {
            const current = s[i];

            if(isCLosedBracket(current)) {
                stack.pop()
            } else {
                stack.push(current)
            }
        }
    }
    function isCLosedBracket(char) {
        return [')', '}', ']'].indexOf(char) > -1;
    }

    return <h1>Hello!</h1>;
}
